pragma solidity >=0.4.21 <0.6.0;

import "@openzeppelin/contracts/token/ERC721/ERC721Full.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MembershipToken is ERC721Full {
    uint tokenId = 0;

    constructor(string memory name) ERC721Full("", "XXX") public {
         _mint(msg.sender, tokenId++);
    }

    function invite(address user) public {
        require(balanceOf(msg.sender) > 0, "Not a member.");
        _mint(user, tokenId++);
    }

    function inviteMembers(address[] memory invitees) public {
        require(balanceOf(msg.sender) > 0, "Not a member.");
        for(uint i = 0; i < invitees.length; i++) {
            _mint(invitees[i], tokenId++);
        }
    }
}
